import React, { useState, useEffect } from 'react';
import { Link as RouterLink } from 'react-router-dom';
import {
  Grid,
  Paper,
  Typography,
  Button,
  Box,
  LinearProgress,
  Card,
  CardContent,
  Alert,
} from '@mui/material';
import { dashboardAPI } from '../services/api';

function Dashboard() {
  const [lastSession, setLastSession] = useState(null);
  const [progress, setProgress] = useState(null);
  const [stats, setStats] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        setError(null);
        const [sessionRes, progressRes, statsRes] = await Promise.all([
          dashboardAPI.getLastStudySession().catch(() => ({ data: null })),
          dashboardAPI.getStudyProgress().catch(() => ({ data: null })),
          dashboardAPI.getQuickStats().catch(() => ({ data: null })),
        ]);

        setLastSession(sessionRes.data);
        setProgress(progressRes.data);
        setStats(statsRes.data);
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
        setError('Failed to load dashboard data. Please try again later.');
      } finally {
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, []);

  if (loading) {
    return <LinearProgress />;
  }

  if (error) {
    return (
      <Alert severity="error" sx={{ mt: 2 }}>
        {error}
      </Alert>
    );
  }

  return (
    <Box>
      <Grid container spacing={3}>
        {/* Last Study Session */}
        <Grid item xs={12}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Last Study Session
              </Typography>
              {lastSession ? (
                <Typography>
                  {new Date(lastSession.created_at).toLocaleString()}
                  {lastSession.group_name && ` - ${lastSession.group_name}`}
                </Typography>
              ) : (
                <Typography color="text.secondary">
                  No study sessions yet
                </Typography>
              )}
            </CardContent>
          </Card>
        </Grid>

        {/* Study Progress */}
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Study Progress
              </Typography>
              {progress ? (
                <Typography>
                  Words studied: {progress.total_words_studied} / {progress.total_available_words}
                </Typography>
              ) : (
                <Typography color="text.secondary">
                  No progress data available
                </Typography>
              )}
            </CardContent>
          </Card>
        </Grid>

        {/* Quick Stats */}
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Quick Stats
              </Typography>
              {stats ? (
                <>
                  <Typography>Total Words: {stats.total_words}</Typography>
                  <Typography>Total Groups: {stats.total_groups}</Typography>
                  <Typography>Study Sessions: {stats.total_sessions}</Typography>
                  <Typography>Study Streak: {stats.streak_days} days</Typography>
                </>
              ) : (
                <Typography color="text.secondary">
                  No statistics available
                </Typography>
              )}
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      <Box mt={3}>
        <Button
          variant="contained"
          color="primary"
          component={RouterLink}
          to="/study"
          fullWidth
        >
          START STUDYING
        </Button>
      </Box>
    </Box>
  );
}

export default Dashboard;
